import React, { useState, useEffect } from 'react';
import './header.css';

export function Header() {
  const [click, setClick] = useState(false);
  const [button, setButton] = useState(true);

  const handleClick = () => setClick(!click);
  const closeMobileMenu = () => setClick(false);

  const showButton = () => {
    if (window.innerWidth <= 960) {
      setButton(false);
    } else {
      setButton(true);
    }
  };

  useEffect(() => {
    showButton();
  }, []);
  return (
    <header>
              <nav className='navbar'>
          <div className='navbar-container container'>
            <a to='/' className='navbar-logo' onClick={closeMobileMenu}>
              <h2>YieldRocket</h2>
            </a>
            <div className='menu-icon' onClick={handleClick}>
              {click ? <h3>o</h3> : <h3>click</h3>}
            </div>
            <ul className={click ? 'nav-menu active' : 'nav-menu'}>
              <li className='nav-item'>
              <a to="/#top"
              scroll={el => el.scrollIntoView({ behavior: 'instant', block: 'start' })}>
              <div className='nav-links'>
                    Home
                  </div>
              </a>
              </li>
              <li className='nav-item'>
                <a smooth to="/#tokenomics"
                scroll={el => el.scrollIntoView({ behavior: 'instant', block: 'center', inline: "nearest" })}>
                  <div className='nav-links'>
                    Tokenomics
                  </div>
                </a>
              </li>
              <li className='nav-item'>
              <a to="roadmap"
              scroll={el => el.scrollIntoView({ behavior: 'instant', block: 'center', inline: "nearest" })}>
                <div className='nav-links'>
                    Roadmap
                  </div>
              </a>
              </li>
              <li className='nav-item'>
              <a to="whitepaper"
              scroll={el => el.scrollIntoView({ behavior: 'instant', block: 'center', inline: "nearest" })}>
                <div className='nav-links'>
                    Whitepaper
                  </div>
              </a>
              </li>
              <li className='nav-item'>
              <a to="cryptonauts">
              <div className='nav-links'>
                    NFT
                  </div>
              </a>
              </li>
              <li className='nav-btn'>
                {button ? (
                  <a to='dashboard' className='btn-link'>
                    <button buttonStyle='btn--outline'>Dashboard</button>
                  </a>
                ) : (
                  <a to='dashboard' className='btn-link'>
                    <button
                      buttonStyle='btn--outline'
                      buttonSize='btn--mobile'
                      onClick={closeMobileMenu}
                    >
                      Dashboard
                    </button>
                  </a>
                )}
              </li>
            </ul>
            </div>
            </nav>
    </header>
  );
}
